module.exports = "---\ntitle: Button React Komponente\ncomponents: Button, IconButton, ButtonBase\n---\n\n# Button (schaltflÃ¤che)\n\n<p class=\"description\">Mit den SchaltflÃ¤chen kÃ¶nnen Benutzer mit einem einzigen Tastendruck Aktionen ausfÃ¼hren und Entscheidungen treffen.</p>\n\n[Buttons](https://material.io/design/components/buttons.html) (SchaltflÃ¤chen / KnÃ¶pfe) geben Aktionen an, die ein Nutzer ausfÃ¼hren kann. Sie werden an verschiedenen Orten in Anwendungen verwendet, zum Beispiel:\n\n- Dialoge\n- Modale Fenster\n- Formulare\n- Cards\n- Toolbars\n\n## Contained Buttons\n\n[Contained buttons](https://material.io/design/components/buttons.html#contained-button) sind hervorgehoben und unterscheiden sich durch die Verwendung von HÃ¶he und FÃ¼llung. Sie enthalten Aktionen, die fÃ¼r Ihre App vorrangig sind.\n\n{{\"demo\": \"pages/components/buttons/ContainedButtons.js\"}}\n\nYou can remove the elevation with the `disableElevation` prop.\n\n{{\"demo\": \"pages/components/buttons/DisableElevation.js\"}}\n\n## Text Buttons\n\n[Text buttons](https://material.io/design/components/buttons.html#text-button) werden normalerweise fÃ¼r weniger ausgeprÃ¤gte Aktionen verwendet, darunter auch solche, die Folgendes enthalten:\n\n- In Dialogen\n- In Karten\n\nIn Karten helfen Text Buttons dabei, den Karteninhalt hervorzuheben.\n\n{{\"demo\": \"pages/components/buttons/TextButtons.js\"}}\n\n## Outlined Buttons\n\n[Outlined Buttons](https://material.io/design/components/buttons.html#outlined-button) sind Buttons mit mittlerer Betonung. Sie enthalten wichtige Aktionen, aber nicht die primÃ¤re Aktion in einer App.\n\nOutlined Buttons sind auch eine Alternative mit geringerer Betonung als Contained Buttons, oder eine Alternative mit hÃ¶herer Betonung als Text Buttons.\n\n{{\"demo\": \"pages/components/buttons/OutlinedButtons.js\"}}\n\n## Handling clicks\n\nAll components accept an `onClick` handler that is applied to the root DOM element.\n\n```jsx\n<Button onClick={() => { alert('clicked') }}>Click me</Button>\n```\n\nNote that the documentation [avoids](/guides/api/#native-properties) mentioning native props (there are a lot) in the API section of the components.\n\n## Upload-Button\n\n{{\"demo\": \"pages/components/buttons/UploadButtons.js\"}}\n\n## GrÃ¶ÃŸen\n\nFancy larger or smaller buttons? Verwende die Eigenschaft `size`.\n\n{{\"demo\": \"pages/components/buttons/ButtonSizes.js\"}}\n\n## Buttons mit Symbolen und Beschriftung\n\nManchmal mÃ¶chten Sie mÃ¶glicherweise Symbole fÃ¼r bestimmte SchaltflÃ¤chen, um die UX der Anwendung zu verbessern, da Logos leichter als einfacher Text erkannt werden. Wenn Sie beispielsweise eine SchaltflÃ¤che zum LÃ¶schen haben, kÃ¶nnen Sie sie mit einem MÃ¼lleimer-Symbol kennzeichnen.\n\n{{\"demo\": \"pages/components/buttons/IconLabelButtons.js\"}}\n\n## Icon Buttons\n\nIcon Buttons finden Sie hÃ¤ufig in App-Bars und Toolbars.\n\nIcons eignen sich auch fÃ¼r UmschaltflÃ¤chen, mit denen eine einzelne Auswahl ausgewÃ¤hlt oder die Auswahl auf z. B. das HinzufÃ¼gen oder Entfernen eines Sterns zu einem Element.\n\n{{\"demo\": \"pages/components/buttons/IconButtons.js\"}}\n\n## Benutzerdefinierte Buttons\n\nHier sind einige Beispiele, wie man die Komponente anpassen kann. Mehr dazu erfahren Sie auf der [Ãœberschreibungsdokumentationsseite](/customization/components/).\n\n{{\"demo\": \"pages/components/buttons/CustomizedButtons.js\", \"defaultCodeOpen\": false}}\n\nðŸŽ¨ Wenn Sie nach Inspiration suchen, sehen sie sich [MUI Treasury's Anpassungs-Beispiele](https://mui-treasury.com/styles/button) an.\n\n## Komplexe Buttons\n\nDie Text Buttons, die Contained Buttons, die Floatin Action Buttons und die Icon Buttons basieren auf derselben Komponente: der `ButtonBase`. Sie kÃ¶nnen die Vorteile dieser grundlegenden Komponente zum erstellen von benutzerdefinierten Interaktionen nutzen.\n\n{{\"demo\": \"pages/components/buttons/ButtonBase.js\"}}\n\n## Drittanbieter-Routing Bibliothek\n\nEin hÃ¤ufig gebrauchtes Feature ist das Wechseln zu einer anderen Seite als Button-Aktion. Die `ButtonBase` Komponente stellt eine Eigenschaft fÃ¼r diesen Anwendungsfall bereit: `component`. FÃ¼r bestimmte Fokus-Polyfills erfordert `ButtonBase` jedoch den DOM-Knoten der bereitgestellten Komponente. Dies wird erreicht, indem der Komponente ein Ref zugeordnet wird und erwartet wird, dass die Komponente diesen Ref an den zugrunde liegenden DOM-Knoten weiterleitet. Given that many of the interactive components rely on `ButtonBase`, you should be able to take advantage of it everywhere.\n\nHier ist ein [Integrationsbeispiel mit react-router](/guides/composition/#button).\n\n## EinschrÃ¤nkungen\n\n### Cursor nicht erlaubt\n\nThe ButtonBase component sets `pointer-events: none;` on disabled buttons, which prevents the appearance of a disabled cursor.\n\nIf you wish to use `not-allowed`, you have two options:\n\n1. **Nur CSS**. You can remove the pointer events style on the disabled state of the `<button>` element:\n\n  ```css\n  .MuiButtonBase-root:disabled {\n    cursor: not-allowed;\n    pointer-events: auto;\n  }\n  ```\n\nAber:\n\n- You should add `pointer-events: none;` back when you need to display [tooltips on disabled elements](/components/tooltips/#disabled-elements).\n- The cursor won't change if you render something other than a button element, for instance, a link `<a>` element.\n\n2. **DOM-Anderung**. You can wrap the button:\n\n  ```jsx\n  <span style={{ cursor: 'not-allowed' }}>\n    <Button component={Link} disabled>\n      disabled\n    </Button>\n  </span>\n  ```\n\nThis has the advantage of supporting any element, for instance, a link `<a>` element."

