module.exports = "---\ntitle: Componente de React Button\ncomponents: Button, IconButton, ButtonBase\n---\n\n# Button (botÃ³n)\n\n<p class=\"description\">Los botones permiten a los usuarios ejecutar acciones, y tomar decisiones, con un simple toque.</p>\n\n[Los botones](https://material.io/design/components/buttons.html) comunican acciones que los usuarios pueden realizar. Usualmente estÃ¡n ubicados dentro de tu interfaz, en lugares como:\n\n- DiÃ¡logos\n- Ventanas modal\n- Formularios\n- Tarjetas\n- Barras de herramientas\n\n## Botones contenidos\n\nLos [Botones contenidos](https://material.io/design/components/buttons.html#contained-button) son de alto Ã©nfasis, distinguidos por el uso de elevaciÃ³n y relleno. Contienen acciones que son primarias para la aplicaciÃ³n.\n\n{{\"demo\": \"pages/components/buttons/ContainedButtons.js\"}}\n\nSe puede eliminar la elevaciÃ³n con la prop `disableElevation`.\n\n{{\"demo\": \"pages/components/buttons/DisableElevation.js\"}}\n\n## Botones de texto\n\nLos [Botones de texto](https://material.io/design/components/buttons.html#text-button) se suelen usar para acciones menos notables, incluyendo las que se encuentran:\n\n- En diÃ¡logos\n- En tarjetas\n\nEn las tarjetas, los botones de texto ayudan a mantener un Ã©nfasis en el contenido de la tarjeta.\n\n{{\"demo\": \"pages/components/buttons/TextButtons.js\"}}\n\n## Botones con Contorno\n\n[Botones con contorno (outlined)](https://material.io/design/components/buttons.html#outlined-button) son de Ã©nfasis medio. Contienen acciones que son importantes, pero no primarias en la app.\n\nLos botones delineados tambiÃ©n son una alternativa de menos Ã©nfasis que los botones contenidos, o de mayor Ã©nfasis que los botones de texto.\n\n{{\"demo\": \"pages/components/buttons/OutlinedButtons.js\"}}\n\n## Handling clicks\n\nAll components accept an `onClick` handler that is applied to the root DOM element.\n\n```jsx\n<Button onClick={() => { alert('clicked') }}>Click me</Button>\n```\n\nNote that the documentation [avoids](/guides/api/#native-properties) mentioning native props (there are a lot) in the API section of the components.\n\n## BotÃ³n de subida\n\n{{\"demo\": \"pages/components/buttons/UploadButtons.js\"}}\n\n## TamaÃ±os\n\nBotones mÃ¡s grandes o mÃ¡s pequeÃ±os? Usa la propiedad `size`.\n\n{{\"demo\": \"pages/components/buttons/ButtonSizes.js\"}}\n\n## Botones con iconos y tÃ­tulos\n\nTal vez se necesita tener iconos para un botÃ³n en particular para mejorar la experiencia del usuario de la aplicaciÃ³n porque se reconocen mÃ¡s fÃ¡cilmente los logos que el texto. Por ejemplo, si se crea un botÃ³n para borrar se le puede poner un icono de papelera.\n\n{{\"demo\": \"pages/components/buttons/IconLabelButtons.js\"}}\n\n## Botones con Iconos\n\nLos botones de iconos suelen encontrarse en las barras de aplicaciones y las barras de herramientas.\n\nLos iconos son tambiÃ©n apropiados para botones toggle que permiten marcar o desmarcar una sola opciÃ³n, tal como poner o quitar una estrella de un elemento.\n\n{{\"demo\": \"pages/components/buttons/IconButtons.js\"}}\n\n## Botones Personalizados\n\nHere are some examples of customizing the component. You can learn more about this in the [overrides documentation page](/customization/components/).\n\n{{\"demo\": \"pages/components/buttons/CustomizedButtons.js\", \"defaultCodeOpen\": false}}\n\nðŸŽ¨ If you are looking for inspiration, you can check [MUI Treasury's customization examples](https://mui-treasury.com/styles/button).\n\n## Botones Complejos\n\nLos Botones de Texto, los Botones Contenidos, los Botones de AcciÃ³n Flotantes y los Botones con Iconos se construyen sobre el mismo componente: el `ButtonBase`. Se puede sacar partido de este componente bÃ¡sico para construir interacciones personalizadas.\n\n{{\"demo\": \"pages/components/buttons/ButtonBase.js\"}}\n\n## LibrerÃ­a externa de routing\n\nUn caso de uso comÃºn es emplear el botÃ³n para iniciar la navegaciÃ³n hacia una nueva pÃ¡gina. El componente `ButtonBase` provee un atributo para tratar este uso: `component`. Sin embargo, para ciertos rellenos `ButtonBase` requiere el nodo DOM del componente proporcionado. Esto se logra adjuntando una referencia al componente y esperando que el componente reenvÃ­e esta referencia al nodo DOM subyacente. Given that many of the interactive components rely on `ButtonBase`, you should be able to take advantage of it everywhere.\n\nHere is an [integration example with react-router](/guides/composition/#button).\n\n## Limitaciones\n\n### Cursor not-allowed\n\nThe ButtonBase component sets `pointer-events: none;` on disabled buttons, which prevents the appearance of a disabled cursor.\n\nIf you wish to use `not-allowed`, you have two options:\n\n1. **CSS only**. You can remove the pointer events style on the disabled state of the `<button>` element:\n\n  ```css\n  .MuiButtonBase-root:disabled {\n    cursor: not-allowed;\n    pointer-events: auto;\n  }\n  ```\n\nHowever:\n\n- You should add `pointer-events: none;` back when you need to display [tooltips on disabled elements](/components/tooltips/#disabled-elements).\n- The cursor won't change if you render something other than a button element, for instance, a link `<a>` element.\n\n2. **DOM change**. You can wrap the button:\n\n  ```jsx\n  <span style={{ cursor: 'not-allowed' }}>\n    <Button component={Link} disabled>\n      disabled\n    </Button>\n  </span>\n  ```\n\nEste tiene la ventaja de permitir cualquier elemento, por ejemplo un enlace `<a>`<a></0>.</p>"

